import styles from "./RegisterProject.module.css";

function RegisterProject() {
  return (
    <>
      <div className={styles.RegisterProject}>
        <header>
          <h1>프로젝트 등록하기</h1>
        </header>
        <div className={styles.projectImg}>
          <h3>배경사진 선택</h3>
        </div>
        <div className={styles.projectName}>
          <h3>프로젝트명</h3>
        </div>
        <div className={styles.projectInfo}></div>
        <div className={styles.recruitmentDiv}></div>
        <div className={styles.language}></div>
        <div className={styles.etc}></div>
      </div>
    </>
  );
}

export default RegisterProject;
